import React from 'react';
import toto from './images/en-tete.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={toto} className="App-logo" alt="toto" />
        <nav>
          <ul>
            <li></li>
            <li></li>  
          </ul>>
        </nav>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
